### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Descriptive Statistics**
- **Measures of Central Tendency**: Mean, Median, Mode.
  - **Mean**: \(\bar{x} = \frac{\sum_{i=1}^{n} x_i}{n}\)
  - **Median**: Middle value in an ordered dataset.
  - **Mode**: Most frequent value in a dataset.
- **Measures of Dispersion**: Variance, Standard Deviation, Range, Interquartile Range (IQR).
  - **Variance**: \(\sigma^2 = \frac{\sum_{i=1}^{n} (x_i - \bar{x})^2}{n}\)
  - **Standard Deviation**: \(\sigma = \sqrt{\frac{\sum_{i=1}^{n} (x_i - \bar{x})^2}{n}}\)
  - **Range**: \( \text{Range} = \text{Max} - \text{Min} \)
  - **IQR**: \( Q3 - Q1 \)
- **Percentiles and Quartiles**:
  - **First Quartile (Q1)**: 25th percentile.
  - **Median (Q2)**: 50th percentile.
  - **Third Quartile (Q3)**: 75th percentile.

#### 2. **Data Types and Scales of Measurement**
- **Categorical Data**: Nominal (e.g., election symbols), Ordinal.
- **Numerical Data**: Continuous (e.g., time taken), Discrete.
- **Structured vs. Unstructured Data**: Structured data follows a predefined format; unstructured data does not.

#### 3. **Data Visualization**
- **Bar Charts**: For categorical data.
- **Scatter Plots**: For visualizing the relationship between two continuous variables.
- **Stem-and-Leaf Plots**: For displaying the distribution of a dataset.

#### 4. **Correlation and Covariance**
- **Correlation Coefficient (r)**: Measures the strength and direction of a linear relationship between two variables.
  - **Formula**: \( r = \frac{\sum_{i=1}^{n} (x_i - \bar{x})(y_i - \bar{y})}{\sqrt{\sum_{i=1}^{n} (x_i - \bar{x})^2 \sum_{i=1}^{n} (y_i - \bar{y})^2}} \)
- **Covariance**: Measures how much two variables change together.
  - **Formula**: \( \text{Cov}(X, Y) = \frac{\sum_{i=1}^{n} (x_i - \bar{x})(y_i - \bar{y})}{n} \)

#### 5. **Contingency Tables**
- **Two-Way Contingency Tables**: Used to display the relationship between two categorical variables.

#### 6. **Data Transformation**
- **Linear Transformation**: \( y = a x + b \)
- **Effect on Measures of Central Tendency and Dispersion**:
  - **Mean**: \( \bar{y} = a \bar{x} + b \)
  - **Variance**: \( \sigma_y^2 = a^2 \sigma_x^2 \)
  - **Standard Deviation**: \( \sigma_y = |a| \sigma_x \)

